import React from 'react';
import classes from "./MyInput.module.css";

const MyInput = ({label, onChange}) => {
    return (
        <div className={classes.MyInput}>
            <input type="number" onChange={onChange} required/>
            <label>{label}</label>
        </div>
    );
};

export default MyInput;
